import { Outlet } from 'react-router-dom';
import '../navigation/navigation.styles.scss';

export const Navigation = () => {
  return (
    <div>
      <div>
        <h1>I am the navigation bar</h1>
      </div>
      <Outlet />
    </div>
  );
};
